import React from 'react';

const Footer = () => {
    const styleSpan = {
        position: "absolute",
        width: "177px",
        height: "22px",

        fontStyle: "normal",
        fontWeight: "400",
        fontSize: "18px",
        lineHeight: "22px",

        color: "#000000"

}
    return (
        <div style={{
            width: "100%",
            height: "198px",
            background: "rgba(0, 0, 0, 0.6)",
            display: "flex"
        }}>
            <div>
                <span style={styleSpan}>Общая информация</span>
                <span style={styleSpan}>Политика конфиденциальности</span>
                <span style={styleSpan}>Пользовательское соглашение</span>
            </div>
            <span>Разработано студентами ЮФУ</span>
        </div>
    );
};

export default Footer;
